// src/services/attendanceService.js
import axios from 'axios';

const ATTENDANCE_API_URL = 'http://localhost:5003/api/attendance';

export const getAttendanceById = (id) =>
    axios.get(`http://localhost:5003/api/attendance/${id}`);
